export const setMinPriceAction = (minPrice) => {
    return {
        type: "PRICE_MIN",
        payload: minPrice
    }
}

export const setMaxPrice = (maxPrice) => {
    return {
        type: "PRICE_MAX",
        payload: maxPrice
    }
}
